import { ThemeProvider } from "@material-ui/core";
import React from "react";
import { render } from "react-dom";
import App from "./App";

const root = document.getElementById("root");
render(
  <React.StrictMode>
    <ThemeProvider >
      <App />
    </ThemeProvider>
  </React.StrictMode>
  ,
  root
 );
